import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart using evaluate to call the global function
    await page.evaluate(() => addToCart(1));
    await page.waitForSelector('#cartCount:text("1")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // Step 2: Open the cart modal
    await page.evaluate(() => showCart());
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // Step 3: Extract initial quantity
    const initialQuantity = await page.locator('.cart-item .quantity').textContent();

    // Step 4: Find and click the increase quantity button (+)
    const increaseButton = page.locator('.cart-item-quantity .quantity-btn', { hasText: '+' });
    await increaseButton.waitFor({ state: 'visible', timeout: 5000 });
    await increaseButton.click();

    // Step 5: Wait for the quantity to update and take a screenshot
    await page.waitForSelector('.cart-item .quantity:text("2")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // Step 6: Extract the final quantity and total price
    const finalQuantity = await page.locator('.cart-item .quantity').textContent();
    const finalTotal = await page.locator('#cartTotal').textContent();

    return {
      success: true,
      action: "Updated cart item quantity",
      extractedData: {
        initialQuantity: parseInt(initialQuantity, 10),
        finalQuantity: parseInt(finalQuantity, 10),
        finalTotal: parseFloat(finalTotal)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
